window.bookSummaryJSON = "<p><b>An instant </b><b><i>New York Times</i></b><b> bestseller! Juliette and Warner’s story continues in the electrifying fourth installment of Tahereh Mafi’s bestselling Shatter Me series.</b></p> <p>The girl with the power to kill with a single touch now has the world in the palm of her hand. Juliette Ferrars thought she’d won. She took over Sector 45, was named the new Supreme Commander of North America, and now has Warner by her side. But when tragedy strikes, she must confront the darkness that dwells both around and inside her.</p> <p>Who will she become in the face of adversity? Will she be able to control the power she wields, and use it for good?</p> <p><b>“Will have fans groaning aloud for the next installment.”—</b><b><i>Booklist</i></b></p> <p><b>And don’t miss </b><b><i>Defy Me</i></b><b>, the shocking fifth book in the Shatter Me series!</b></p> <p><b>Please note:</b> This is an historical recording. The audio quality represents the technology of the time when it was produced.</p>"; 
